import React, { useState } from 'react';
import { Plus, Trash2, Copy } from 'lucide-react';
import { useSettings } from '../context/SettingsContext';
import Toast from './Toast';
import './HeadersTab.css';

const HeadersTab = ({ headers, onChange, onAddHeader }) => {
  const { language } = useSettings();
  const [toast, setToast] = useState({ show: false, message: '', type: 'success' });

  const updateHeader = (index, field, value) => {
    const newHeaders = [...headers];
    newHeaders[index] = { ...newHeaders[index], [field]: value };
    onChange(newHeaders);
  };

  const removeHeader = (index) => {
    const newHeaders = headers.filter((_, i) => i !== index);
    onChange(newHeaders);
  };

  const toggleHeader = (index) => {
    const newHeaders = [...headers];
    newHeaders[index] = { ...newHeaders[index], enabled: !newHeaders[index].enabled };
    onChange(newHeaders);
  };

  const addPresetHeader = (preset) => {
    onChange([...headers, { ...preset, enabled: true }]);
  };

  // 复制header到剪贴板
  const handleCopyHeaders = async () => {
    const enabledHeaders = headers.filter(h => h.enabled && h.key);
    const text = enabledHeaders.map(h => `${h.key}: ${h.value}`).join('\n');
    try {
      await navigator.clipboard.writeText(text);
      setToast({ show: true, message: language === 'zh' ? '请求头已复制' : 'Headers copied', type: 'success' });
    } catch {
      setToast({ show: true, message: language === 'zh' ? '复制失败' : 'Copy failed', type: 'error' });
    }
  };

  const hideToast = () => setToast({ show: false, message: '', type: 'success' });

  return (
    <div className="headers-tab">
      <div className="headers-header">
        <h3>{language === 'zh' ? '请求头' : 'Request Headers'}</h3>
        <button className="btn copy-btn" onClick={handleCopyHeaders} title={language === 'zh' ? '复制请求头' : 'Copy headers'}>
          <Copy size={16} />
          {language === 'zh' ? '复制' : 'Copy'}
        </button>
      </div>
      <div className="headers-list">
        {headers.length === 0 ? (
          <div className="empty-state">
            <p>{language === 'zh' ? '暂无请求头' : 'No headers'}</p>
          </div>
        ) : (
          headers.map((header, index) => (
            <div key={index} className="header-row">
              <div className="header-controls">
                <input
                  type="checkbox"
                  checked={header.enabled}
                  onChange={() => toggleHeader(index)}
                  className="header-checkbox"
                />
                <button
                  className="btn btn-danger remove-btn"
                  onClick={() => removeHeader(index)}
                >
                  <Trash2 size={14} />
                </button>
              </div>
              <input
                type="text"
                className="header-key"
                placeholder={language === 'zh' ? '请求头名称 (例如: Content-Type)' : 'Header name (e.g., Content-Type)'}
                value={header.key}
                onChange={(e) => updateHeader(index, 'key', e.target.value)}
                disabled={!header.enabled}
              />
              <input
                type="text"
                className="header-value"
                placeholder={language === 'zh' ? '请求头值 (例如: application/json)' : 'Header value (e.g., application/json)'}
                value={header.value}
                onChange={(e) => updateHeader(index, 'value', e.target.value)}
                disabled={!header.enabled}
              />
            </div>
          ))
        )}
      </div>

      <div className="preset-headers">
        <h4>{language === 'zh' ? '常用请求头' : 'Common Headers'}</h4>
        <div className="preset-buttons">
          {[
            { key: 'Content-Type', value: 'application/json' },
            { key: 'Authorization', value: 'Bearer your-token' },
            { key: 'Accept', value: 'application/json' },
            { key: 'User-Agent', value: 'API-Testing-Platform/1.0' }
          ].map((preset, index) => (
            <button
              key={index}
              className="btn preset-btn"
              onClick={() => addPresetHeader(preset)}
            >
              {preset.key}
            </button>
          ))}
        </div>
      </div>
      <Toast isVisible={toast.show} message={toast.message} type={toast.type} onClose={hideToast} duration={2000} />
    </div>
  );
};

export default HeadersTab;
